/*!50003 CREATE*/ /*!50017 DEFINER=`root`@`localhost`*/ /*!50003 TRIGGER cs_trigger AFTER UPDATE ON cs_data FOR EACH ROW
             BEGIN
                 IF OLD.price <> NEW.price THEN
                     INSERT INTO cs_change VALUE(OLD.aid, OLD.price, NEW.price,
                                          OLD.total, NEW.total, NOW());
                 END IF;
                 IF OLD.size <> NEW.size THEN
                     INSERT INTO cs_change VALUE(OLD.aid, ROUND(OLD.size),
                                          ROUND(NEW.size), OLD.total,
                                          NEW.total, NOW());
                 END IF;
             END */;;
