/*!50003 CREATE*/ /*!50017 DEFINER=`root`@`localhost`*/ /*!50003 TRIGGER ml_trigger AFTER UPDATE ON ml_data FOR EACH ROW
             BEGIN
                 IF OLD.price <> NEW.price THEN
                     INSERT INTO ml_change VALUE(OLD.aid, OLD.price, NEW.price,
                                          OLD.total, NEW.total, NOW());
                 END IF;
                 IF OLD.size <> NEW.size THEN
                     INSERT INTO ml_change VALUE(OLD.aid, ROUND(OLD.size),
                                          ROUND(NEW.size), OLD.total,
                                          NEW.total, NOW());
                 END IF;
             END */;;
