/*!50003 CREATE*/ /*!50017 DEFINER=`root`@`localhost`*/ /*!50003 TRIGGER sjdxc_trigger AFTER UPDATE ON sjdxc_data FOR EACH ROW
             BEGIN
                 IF OLD.price <> NEW.price THEN
                     INSERT INTO sjdxc_change VALUE(OLD.aid, OLD.price, NEW.price,
                                          OLD.total, NEW.total, NOW());
                 END IF;
                 IF OLD.size <> NEW.size THEN
                     INSERT INTO sjdxc_change VALUE(OLD.aid, ROUND(OLD.size),
                                          ROUND(NEW.size), OLD.total,
                                          NEW.total, NOW());
                 END IF;
             END */;;
